import { toHaveDisplayValue } from '@testing-library/jest-dom/dist/matchers';
import React, { Component } from 'react'
import Select from 'react-select'

export class DisplayPanel extends Component {
    constructor(props){
        super(props);
        this.state = {category: '', bundle: ''}
        this.temp = [{label: 'bundle1', value: 1}, {label: 'bundle2', value: 2}]
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    async handleSubmit(event){

    }

  render() {
    return (
        <>
        {/* {this.onDataChange()} */}
      <div>DisplayPanel</div>
      <select name="selectList" id="selectList" onChange={this.categoryChange}>
                 <option value="5ff5a1d93bbf9374326985de">Love Frames</option>
                 <option value="5ff7fab5f0dfd4c8479c5912">Comic Frames</option>
                 <option value="5ff5a1d93bbf9374326985db">Birthday Frames</option>
                 <option value="5ff7fab5f0dfd4c8479c5913">Magazine Frames</option>
                 <option value="5ff7fab5f0dfd4c8479c5914">News Frames</option>
      </select>
      <select name="selectList" id="selectList" onChange={this.bundleChange}>
                 <option value="bundle1">Bundle 1</option>
                 <option value="bundle2">Bundle 2</option>
                 <option value="bundle3">Bundle 3</option>
                 <option value="bundle4">Bundle 4</option>
                 <option value="bundle5">Bundle 5</option>
                 <option value="bundle6">Bundle 6</option>
                 <option value="bundle7">Bundle 7</option>
                 <option value="bundle8">Bundle 8</option>
                 <option value="bundle9">Bundle 9</option>
                 <option value="bundle10">Bundle 10</option>
                 <option value="bundle11">Bundle 11</option>
                 
      </select>

      <Select options={this.temp} />

      <br/>
      {
        
        this.props.data.map(result=>(
          <>
            
            {/* <img src={result}></img> */}
          </>
        ))
      }
      </>
    )
  }
}

export default DisplayPanel
